import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { HtmlTutorialComponent } from './components/html-tutorial/html-tutorial.component';
import { CssTutorialComponent } from './components/css-tutorial/css-tutorial.component';
import { BootstrapTutorialComponent } from './components/bootstrap-tutorial/bootstrap-tutorial.component';

const routes: Routes = [
  {
    path : 'html', component : HtmlTutorialComponent
  },

  {
    path : 'css', component : CssTutorialComponent
  },

  {
    path : 'boostrap', component : BootstrapTutorialComponent
  }
];

@NgModule({
  imports: [RouterModule.forRoot(routes)],
  exports: [RouterModule]
})
export class AppRoutingModule { }
